tool format_comparison(label: string, current: number, previous: number) -> string {
    let change = current - previous
    if change > 0 {
        return label + ": " + current + " (+" + change + " from " + previous + ")"
    } else {
        if change < 0 {
            return label + ": " + current + " (" + change + " from " + previous + ")"
        } else {
            return label + ": " + current + " (unchanged)"
        }
    }
}

